webpackJsonp([29724051260332],{347:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Conversational and friendly without being overly colloquial or frivolous.</p>\n<table>\n<thead>\n<tr>\n<th>Good</th>\n<th>Bad</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>This API lets you collect data about what your users like.</td>\n<td>The API documented by this page may enable the acquisition of information pertaining to user preferences.</td>\n</tr>\n<tr>\n<td>To get the user\'s phone number, call \n<code>user.phoneNumber.get()</code>\n.</td>\n<td>The telephone number can be retrieved by the developer via the simple expedient of using the \n<code>get()</code>\n method on the \n<code>user</code>\n object\'s \n<code>phoneNumber</code>\n property.</td>\n</tr>\n</tbody>\n</table>\n<p>For more information, see <a href="https://developers.google.com/style/tone" target="_blank" rel="nofollow noopener noreferrer">Style and authorial tone</a>.</p>',frontmatter:{title:"Tone"}}},pathContext:{slug:"/readme-docs/tone/"}}}});
